import Layout from './components/MyLayout';
import Link from 'next/link';

export default function Investors() {
  return (
    <Layout>
      <div className="investors">
      <h5>Home > The Managament Team</h5>
        <hr/>
<br/>
<br />
<article>
  <section>
    <h2>The Managment Team</h2>

        </section>
        <section>
         <div className="product-card">
            <img src="https://dummyimage.com/300x300/7EC0EE/000&text=Product+Image+1" alt="Product image 1" />
            <h4><a href="">Video title 1</a></h4>
            <p className="original-price">RRP: £18.99</p>
        </div>
        <div className="product-card">
            <img src="https://dummyimage.com/300x300/7EC0EE/000&text=Product+Image+1" alt="Product image 1" />
            <h4><a href="">Video title 1</a></h4>
            <p className="original-price">RRP: £18.99</p> 
        </div>
        <div className="product-card">
            <img src="https://dummyimage.com/300x300/7EC0EE/000&text=Product+Image+1" alt="Product image 1" />
            <h4><a href="">Video title 1</a></h4>
            <p className="original-price">RRP: £18.99</p>
        </div>
        <div className="product-card">
            <img src="https://dummyimage.com/300x300/7EC0EE/000&text=Product+Image+1" alt="Product image 1" />
            <h4><a href="">Video title 1</a></h4>
            <p className="original-price">RRP: £18.99</p>
         
        </div>
  </section>
</article>

      </div>
      <style jsx>{`
.investors{
    margin: 5em;
}
.investors img{
  width: 100%;
}
    
.investors p{
  font-size: 1em;
  margin: 1em 0 1em 0;
}
.investors h1{
  margin: 1em 0 0.2em 0;

}

.investors h2{
  color:grey;
}

.product-card{
              display: inline-block;
              border: 1px solid black;
              padding: 15px;
              box-sizing: border-box;
              width: fit-content;
              margin: 20px;
          }

          .product-card img{
              width: 100%;
          }
          .product-card h2 {
    margin: 30px 0 15px;
  }
  .product-card a {
    color: black;
    text-decoration: none;
  }
  .product-card p {
    line-height: 1.5;
  }
  .original-price {
    color: gray;
    text-transform: uppercase;
  }
  .current-price span {
    font-weight: bold;
    text-decoration: underline;
  }

  .saving {
    color: green;
  }

  .intro{
           margin: 30px 0;
           padding-left: 10px;
           width: 50%;
       }
       .intro h1{
          margin-bottom: 15px; 
       }

       .intro p{
           line-height: 1.5;
       }
@media only screen and (max-width: 800px){
  .investors{
    margin:1em;
    padding-top:30px;
  }
}
   
    `}</style>
    </Layout>
  );
}
